import React from "react";
import '../styles/home.style.css'
import { config } from '../config'
import axios from 'axios'

class Home extends React.Component {

     constructor(){
          super()
          this.state = {
               broadcasters : []
          }
          this.GetBroadCasters()
     }

     GetBroadCasters = async () => {
          try {
               let res = await axios.get(`http://${config.NODE_IP}:${config.NODE_PORT}/broadcaster/list`)
               let broadcaster = await res.data
               this.setState({
                    broadcaster : broadcaster
               })
          } catch (error) {
               console.log(error)
               return
          }
     }

     render() {
          return (
               <div>
                    <h1>Streamer online</h1>
                    <ul>
                         {this.state.broadcasters.map((bc, i) => {
                              return <li>{bc}</li>
                         })}
                    </ul>
               </div>
          )
     }
}

export default Home;
